    // Update the datalist options with the list of tickers
    async function updateOptions() {
        datalist.innerHTML = '';
        for (const ticker of tickers) {
            if (ticker.Symbol.startsWith(input.value.toUpperCase())) {
                const option = document.createElement('option');
                option.value = `${ticker.Symbol} ${ticker.Name}`;
                datalist.appendChild(option);
            }
        }
    }

    // Update the options whenever the input value changes
    input.addEventListener('input', updateOptions);
</script>
